import React, { useEffect, useState } from 'react';

const FormProduct = (props) => {

    const product = props?.product;
    console.log('product edit', product.image)

    const [formData, setFormData] = useState({

    });



    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Gửi formData đến backend để lưu sản phẩm
        console.log(formData);
        // Reset form
        setFormData({
            image: '',
            name: '',
            category: '',
            type: '',
            price: '',
            size: '',
            origin: '',
            quantity: '',
            description: '',
            role: ''
        });
    };

    return (
        <form onSubmit={handleSubmit}>
            <div className="mb-3">
                <label htmlFor="image" className="form-label">Image URL</label>
                <input type="text" className="form-control" id="image" name="image" value={product.image || formData.image} onChange={handleChange} />
            </div>
            <div className="mb-3">
                <label htmlFor="name" className="form-label">Product Name</label>
                <input type="text" className="form-control" id="name" name="name" value={product.name || formData.name} onChange={handleChange} />
            </div>
            <div className="mb-3">
                <label htmlFor="category" className="form-label">Category</label>
                <select className="form-select" id="category" name="category" value={formData.category} onChange={handleChange}>
                    <option value="">Select category</option>
                    {/* Add options dynamically */}
                </select>
            </div>
            <div className="mb-3">
                <label htmlFor="type" className="form-label">Type</label>
                <input type="text" className="form-control" id="type" name="type" value={product.type || formData.type} onChange={handleChange} />
            </div>
            <div className="mb-3">
                <label htmlFor="price" className="form-label">Price</label>
                <input type="number" className="form-control" id="price" name="price" value={product.price.toFixed(3) || formData.price} onChange={handleChange} />
            </div>
            <div className="mb-3">
                <label htmlFor="size" className="form-label">Size</label>
                <input type="text" className="form-control" id="size" name="size" value={product.size || formData.size} onChange={handleChange} />
            </div>
            <div className="mb-3">
                <label htmlFor="origin" className="form-label">Origin</label>
                <input type="text" className="form-control" id="origin" name="origin" value={product.brand || formData.origin} onChange={handleChange} />
            </div>
            <div className="mb-3">
                <label htmlFor="quantity" className="form-label">Quantity</label>
                <input type="number" className="form-control" id="quantity" name="quantity" value={product.quantity || formData.quantity} onChange={handleChange} />
            </div>
            <div className="mb-3">
                <label htmlFor="description" className="form-label">Description</label>
                <textarea className="form-control" id="description" name="description" value={product.description || formData.description} onChange={handleChange}></textarea>
            </div>
            <div className="mb-3">
                <label htmlFor="role" className="form-label">Role</label>
                <input type="text" className="form-control" id="role" name="role" value={product.role || formData.role} onChange={handleChange} />
            </div>
            <button type="submit" className="btn btn-primary">Submit</button>
        </form>
    )
}

export default FormProduct
